import React, { Component } from 'react';
import { Link } from "react-router-dom";



class Nav extends Component {
    render() {
        return (

            <div className="row menuSegundario">
                <div className="col-6 justify-content-center my-2 d-flex">
                    <nav className="nav flex-column">
                        <Link to={'/Pasteles'}> <a className="btn btn-success bg-success text-white mb-1">Pasteles</a> </Link>
                        <Link to={'/Galletas'}> <a className="btn btn-success bg-success text-white mb-1">Galletas</a> </Link>
                        <Link to={'/Cremas Dulces'}> <a className="btn btn-success bg-success text-white mb-1"> Cremas Dulces </a> </Link>
                        <Link to={'/Bizcochos'}> <a className="btn btn-success bg-success text-white mb-1">Bizcochos</a> </Link>
                        <Link to={'/Magdalenas'}> <a className="btn btn-success bg-success text-white mb-1"> Magdalenas </a> </Link>
                        <Link to={'/Mousse'}> <a className="btn btn-success bg-success text-white mb-1"> Mousse </a> </Link>
                        <Link to={'/Recetas Faciles'}> <a className="btn btn-success bg-success text-white mb-1"> Recetas Faciles </a> </Link>
                    </nav>
                </div>
            </div>
        )
    }
}

export default Nav;
